import React from "react";


const ToDo = (props) => {
    return(
        <div>
            {props.list
            .map(choose =>
                {if (choose.active === "deactivated"){  
                return (
                <div >
                    <div style={{display: "inline"}} key = {choose.lp}>{choose.lp}. {choose.text}, {choose.date}</div>
                    <input 
                            type = "button" 
                            onClick = {event => props.deleteEvent(choose)}
                            value ="Przycisk usuń"/>
                    <input 
                            type = "button" 
                            onClick = {event => props.addDone(choose)}
                            value ="Przycisk zakończ zadanie"/>
                </div>)}
            else{
                return (
                    <div style={{display: "inline"}} key = {choose.lp}>{choose.lp}. {choose.text}, {choose.date}</div>)
            }    
            })}
        </div>
    )
}

export default ToDo;
